import React from "react";
import { View, StyleSheet, Button } from "react-native";

const HomeScreen = ({ navigation }) => {
  return (
    <View>
      <Button 
        title="Data Structures" 
        onPress={() => navigation.navigate('Data')}
      />  
    </View>
  );
};
